import React from 'react';
import logo from './Yorkshire-Water-logo.jpg';
import './App.css';
import {Button} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="App">
      <header >
        <img src={logo} className="App-logo" alt="logo" width="400" height="200"/>
        <p>
          TEST TEST TEST
        </p>
        <Button variant="outline-primary" id = "data-import" width="4000" height="200">
          Upload Data
        </Button>
      </header>
    </div>
  );
}

export default App;
